import React, { useState, useEffect } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import { FormContainer, FormCard, FormTitle, FormWrapper } from "../styles/formStyles"; 
import { uploadImage } from "../utils/uploadService";
import { FormFields } from "../components/FormFields";
import FormActions from "../components/FormActions";
import BackToHomeButton from "../components/BackToHomeButton";

const FormPage = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const existingData = location.state?.item || null;

  const [formData, setFormData] = useState({
    name: "",
    description: "",
    location: "",
    type: "",
    image: "",
    propertyType: "",
    area: "",
    rooms: "",
    price: "",
    brand: "",
    model: "",
    year: "",
    mileage: "",
    serviceType: "",
    experience: "",
    cost: "",
    workSchedule: "",
  });

  useEffect(() => {
    if (existingData) {
      setFormData(existingData);
    }
  }, [existingData]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleImageUpload = async (e) => {
    const file = e.target.files[0];
    if (!file) return;

    const imageUrl = await uploadImage(file);
    setFormData({ ...formData, image: imageUrl });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    fetch(existingData ? `/items/${existingData.id}` : "/items", {
      method: existingData ? "PUT" : "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(formData),
    }).then(() => navigate("/list"));
  };

  return (
    <FormWrapper> {/* ‚úÖ –ì–ê–†–ê–ù–¢–ò–†–£–ï–ú, –ß–¢–û –ö–ù–û–ü–ö–ê –ë–£–î–ï–¢ –ù–ò–ñ–ï */}
      <FormContainer>
        <FormCard>
          <FormTitle>{existingData ? "–†–µ–¥–∞–∫—Ç–∏—Ä–æ–≤–∞—Ç—å –æ–±—ä—è–≤–ª–µ–Ω–∏–µ" : "–†–∞–∑–º–µ—Å—Ç–∏—Ç—å –æ–±—ä—è–≤–ª–µ–Ω–∏–µ"}</FormTitle>

          <form onSubmit={handleSubmit}>
            <FormFields formData={formData} handleChange={handleChange} />
            <FormActions isEditing={!!existingData} />
          </form>
        </FormCard>
      </FormContainer>

      {/* ‚úÖ –ö–ù–û–ü–ö–ê –ù–ò–ñ–ï */}
      <BackToHomeButton />
    </FormWrapper>
  );
};

export default FormPage;
